import './side-bar.styles.scss';

const SideBar = () => {
  return (
    <div className="side-bar-container">
      <div className="side-bar-header-container">
        <div className="conversations">Conversations</div>
        <div className="contacts">Contacts</div>
      </div>
      <div className="new-convo-container">
        <div></div>
        <button type="button">New Conversation</button>
        <p className="username">Your username (to update)</p>
      </div>
    </div>
  );
};

export default SideBar;
